kmeans_perf = file_size[:,2] / file_size[:,0]


jpeg_mean = jpeg_perf.mean()
kmeans_mean = kmeans_perf.mean()

jpeg_std = jpeg_perf.std()
kmeans_std = kmeans_perf.std()

jpeg_conf_var = 1.96 * jpeg_std / np.sqrt(len(jpeg_perf))
kmeans_conf_var = 1.96 * kmeans_std / np.sqrt(len(kmeans_perf))

jpeg_conf_upper = jpeg_mean + jpeg_conf_var
jpeg_conf_lower = jpeg_mean - jpeg_conf_var

kmeans_conf_upper = kmeans_mean + kmeans_conf_var
kmeans_conf_lower = kmeans_mean - kmeans_conf_var



print("jpeg:")
print(f"     mean: {jpeg_mean}")
print(f"      std: {jpeg_std}")
print(f"     conf: {jpeg_conf_var}")
print(f"    conf+: {jpeg_conf_upper}")
print(f"    conf-: {jpeg_conf_lower}")

print('-' * 8)

print("kmeans:")
print(f"     mean: {kmeans_mean}")
print(f"      std: {kmeans_std}")
print(f"     conf: {kmeans_conf_var}")
print(f"    conf+: {kmeans_conf_upper}")
print(f"    conf-: {kmeans_conf_lower}")

